import "./App.css";
import { Footer } from "./components/footer/Footer";
import { Header } from "./components/header/Header";
import { Search } from "./components/search/Search";

function App() {
  return (
    <div>
      <Header />

      <main className="main">
        <section className="card users-container">
          <Search />
        </section>
      </main>

      <Footer />
    </div>
  );
}

export default App;
